webpackJsonp([1101],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-the-javascript-return-statement.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Introduction</h2>\n<p>When a <strong>return</strong> statement is called in a function, the execution of this function is stopped. If specified, a given value is returned to the function caller. If the expression is omitted, <code>undefined</code> is returned instead.</p>\n<pre><code>return [[expression]];\n</code></pre>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/return">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/library/22a685h9.aspx">MSDN link</a></p>\n<h2>Examples</h2>\n<p>The following function returns the square of its argument, <strong>x</strong>, where <strong>x</strong> is a number.</p>\n<pre><code>function square(x) {\n   return x * x;\n}\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/C7VT/0">Run Code</a></p>\n<p>The following function returns the product of its arguments, <strong>arg1</strong> and <strong>arg2</strong>.</p>\n<pre><code>function myfunction(arg1, arg2){\n   var r;\n   r = arg1 * arg2;\n   return(r);\n}\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/C7VU/0">Run Code</a></p>',frontmatter:{title:"the javaScript Return Statement",parent:"/home/stuart/guides/src/pages/articles/javascript/the-javascript-return-statement/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/the-javascript-return-statement/"}}}});
